import React from "react";
import "./style.css";

function Hero () {
    return (
        <div id="hero">
            <div id="hero-text">
                <p>Texas Mountain Laurel (<span>Sophora secundiflora</span>)</p>
            </div>
        </div>
    );
}

export default Hero;
